			loadUserProfile(){
				//#ifdef APP-PLUS
				let uuid = plus.device.uuid
				uuid = uuid.replace(",","0")
				this.$store.dispatch('userProfile',{uuid:uuid})
				jyJPush.setJYJPushAlias({userAlias: uuid},result=>{});
				//#endif
				// #ifdef H5
				this.$store.dispatch('userProfile')
				// #endif
			},
